                oldData = $(""input"", this).attr(""id"");
                $(""input"", this).attr(""id"", oldData.replace(oldId, newId));
                newId++;
            });
        }

        function addDeleteEvent(elem) {
            $("".delete-date-button"", elem).click(function () {
                $(elem).remove();
                renumerateForm();
            });
